fields.description:
Лучший тренажер из линейки EMS! Новый процессор QH91 способен генерировать частоту импульсов таким образом, что они воздействуют не на ткани, а на нервные окончания, которые приводят в тонус мышцы и заставляют их тренироваться даже без вашего участия. Рефлекторные сокращения, глубокие и приятные "качки" мышечных волокон обеспечивают безупречный пампинг.
    
    Глубокий контроль мышц - вот что делает тренировку продуктивной, здесь контролем занимается процессор QH91 . Больше не нужны годы тренировок, чтобы научится правильно сокращать мускулы, разработчики и лучшие тренера уже все сделали сами. Достаточно просто приложить тренажер к любому участку тела, выбрать режим тренировки и весь опыт фитнес индустрии будет работать на тебя.
    Это не только полезно, но и приятно! Заменяет массаж, снимает боль в мышцах, делает кожу более эластичной за счёт стимуляции самых мелких волокон.

Разнообразие программ позволит:
- тренироваться,
- наслаждаться массажем,
- сжигать подкожный жир,
- держать мышцы в тонусе или наращивать их.
Результаты программы "тренировка" видны уже спустя 5 дней!

- 6 режимов тренировки: от массажа и анти-целлюлитных программ до наращивания мускулатуры!
- Имеет 3 пары электродных накладок, что позволяет одновременно тренировать все группы мышц брюшного пресса, талии, а в положении сзади - мышцы спины!
- Два тренажера на два сектора воздействия (бицепсы, трицепсы, косые мышцы живота и т.д.). Отлично подходят для точечного массажа. 
- Cчитается профессиональным миостимулятором!
Выполняйте упражнения во время чтения и домашних дел, в деловых поездках или даже в праздничные дни. 

EMS-trainer можно носить под одеждой, что облегчает тренировки, даже когда вы на работе или в куда-то идете. Все, что вам нужно сделать, это настроить тренажер под себя и позволить ему тренировать мышцы, чтобы помочь вам достичь еще более красивое телосложения.

ФУНКЦИИ ТРЕНАЖЕРА:
- Ритмичное воздействие - снижает давления и снимает стрессы;
- Глубокое действие - улучшает микроциркуляцию крови;
- Тренировка - усиление нагрузки на мышцы;
- Легкое покалывание - снимает боли и предотвращает усталость;
- Длительное воздействие - восстанавливает эластичность кожи;
- Массаж - для похудания и сжигания лишних калорий;

Характеристики:

Питание: по 2 * AAA (не входит в комплект)
Регулируемая интенсивность: 6 уровней;
Мощность: 9,8 mA;
Частота: 25 Гц;
Время непрерывной работы: 12 минут;
Размер: 19 х 17 х 0,2 см;
Цвет: черный;
Вес: 50 г.
